import React, { Component } from 'react'
import TarbarS from "../components/TarBarS";
export default class home extends Component {
    constructor(){
        super()
    }
    render() {
        return (
            <div>
                <TarbarS homeObj={this}></TarbarS>
            </div>
        )
    }
}
